    false,nt"url": null,nt"notes": "This part of DS 781 presents data for the
    depth-to-transition map of the Pigeon Point to South Monterey Bay, California, region.
    The raster data file is included in "DepthToTransition_PigeonPointToSouthMontereyBay.zip,"
    which is accessible from http://dx.doi.org/10.5066/F7N29V0Z As part of the USGS's
    California State Waters Mapping Project, a 50-m grid of sediment thickness for the
    seafloor within the limit of Californiau00e2u0080u0099s State Waters between Pigeon
    Point and Southern Monterey Bay was generated from seismic-reflection data collected
    in 2009 and 2010 (USGS activities (S-15-10-NC and S-N1-09-MB) supplemented with
    outcrop and geologic structure from DS 781. The resulting grid covers an area of
    approximately 850 sq km. The depth to the transgressive surface of the Last Glacial
    Maximum ranges between 2.8 and 252.4 meters. Contours at 5-meter intervals were
    derived from this grid.",nt"license_title": null,nt"extras": [{ntt"key":
